INSERT INTO `teams_problem` (`id`, `name`, `description`, `input_format`, `output_format`, `constraints`, `time_limit`, `memory_limit`, `points`, `sample_input`, `sample_output`, `ac`, `wa`, `re`, `tle`) VALUES
(3, 'Fortune', 'The Evil Cow has recently discovered a foolproof strategy to make money on the stock market. Obviously, he will not disclose it to you and me but claims instead that the money he possesses squares itself after every day. He starts off with 2 units of money initally. Thus afer the first day he has 4 units of money, 16 after the second day and so on. Being someone easily intimidated with large numbers, you need to find out how much money he has after ''N'' days modulo a number ''K''.', 'The first line of the input file contains an integer ''T'', the number of test cases. ''T'' lines follow each containing two space separated integers, ''N'' and ''K''.', 'For each test case, a single line containing the answer to the test case.', '1 <= T <= 1000 <br/> 1<= N, K <= 10<sup>9</sup><br/>K is odd.<br/>', 1, 32, 1, '2<br/>1&nbsp;99<br/>2&nbsp;99<br/>', '4<br/>16<br/>', 36, 240, 162, 394),
(1, 'Square Colouring', 'Gilmax likes to colour things. He has recently acquired a large square drawing board of length N, which he has divided into unit squares. He wants to colour each of the N * N squares with a particular colour. Gilmax follows a systematic method of colouring. He starts colouring the rows from top to bottom. He colours a particular row by colouring its squares from left to right. The colour he assigns to a particular square is his most preferred colour which has not already been used in the same column or row of the square. Assume that Gilmax has an endless supply of colours which he has numbered 0, 1, 2 and so on in decreasing order of his preference for them. Help Gilmax colour the board.', 'The first line of the input file contains an integer ''T'', the number of test cases. ''T'' lines follow each containing two space separated integers, ''X'' and ''Y''.', 'For each test case, output a single line containing the colour Gilmax should use for the square at the X''th row from the top and Y''th column from the left (0 based) of the board. ', '1 <= T <= 10000 <br/> 0 <= X<sub>i</sub> , Y<sub>i</sub> <= 1000000 <br/> X<sub>i</sub> , Y<sub>i</sub> < N', 1, 32, 1, '3<br/>0&nbsp;3<br/>4&nbsp;5<br/>0&nbsp;0', '3<br/>1<br/>0', 83, 181, 103, 31),
(2, 'Number Game', 'Srivatsan, who is fond of game theory problems, convinces Prashant, an admirer of ''classic'' movies, to play a game. The game begins with several integers.  Srivatsan and Prashant play alternately with Srivatsan starting the game ( having seen a lot of problems where the first player has a winning strategy,  he feels that this will give him an advantage ). In each turn, a player chooses two integers ''a'' and ''b'' and replaces them by ''a + b - t'', where ''t'' is the number of the turn ( ''t'' = 1 in the first turn and increases by 1 after each turn ). The game ends when there is only one integer left on the board. Prashant wins if this integer is divisible by 2, and Srivatsan otherwise. Assuming that both players play optimally, determine who will win the game. ', 'The first line contains an integer ''T'', the number of test cases.<br/>The test cases follow, each containing 2 two lines. The first line of each test case contains ''N'', the number of integers in the game.<br/> The next line contains ''N'' space separated integers A<sub>i</sub>, denoting the integers chosen at the beginning of the game.', 'For each test case, output a single line containing "WIN" if Srivatsan wins or "LOSE" if Prashant wins. ', '1 <= T <= 100<br/> 1 <= N <= 100 <br/> 1 <= A<sub>i</sub> <= 100<br/>', 1, 32, 1, '2<br/>2<br/>4&nbsp;5<br/>2<br>4&nbsp;6<br/>', 'LOSE<br/>WIN', 172, 242, 79, 15),
(4, 'Subset Sum', 'Find the number of subsets of {1,2,3,...,N} whose sum is divisible by K. Given, K is a prime number dividing N.<br/><strong> Output the answer modulo 1000000007</strong>.', 'The first line of the input file contains an integer ''T'', the number of test cases. ''T'' lines follow each containing two space separated integers, ''N'' and ''K''.', 'For each test case a single line, containing the answer to the test case.', '1 <= T <= 1000 <br/> 1 <= N , K <= 10<sup>9</sup><br/>', 1, 32, 1, '2<br/>33<br/>22', '4<br/>2', 12, 28, 10, 29),
(5, 'Packing Chemicals', 'Booba, a budding entrepreneur, has recently started a biotechnology firm. He needs to pick out some chemicals for the same. He visits a pharmaceutical company. Unfortunately, it has limited stocks of all the items. Each item has a cost and some value it adds to Booba''s company. Booba needs to choose the chemicals so that the value added to the company is maximised and the sum of the costs does not exceed his budget. Since optimisation is his Achilles'' heel, he has offered you the post of the head of the bio-informatics division if you help him out. ', 'The first line of the input file contains an integer ''T'', the number of test cases followed by ''T'' test cases. First line of each test case contains ''N'' and ''W" -- number of different types of chemicals and Booba''s budget. Description of the items is given in the next ''N'' lines. Each line contains W<sub>i</sub>, V<sub>i</sub> and F<sub>i</sub> denoting the cost of one item of that type, value of one item of that type and the number of chemicals of that type available.', 'For each test case, output the maximum value that can be obtained.', '1 <= T <= 10 <br/> 1 <= N <= 10, 1 <= W <= 10^8 <br/> 1<=W<sub>i</sub>, V<sub>i</sub> <= 10 <sup>7</sup> <br/>1<= F<sub>i</sub><= 15', 5, 64, 1, '1<br/>3100<br/>1 1 10<br/> 1 2 10<br/> 1 3 10 <br/>', '60', 16, 126, 101, 31),
(6, 'Counting Strings ', 'Gurups has recently taken a course in pattern recognition. Course work has made him so adept at identifying patterns that he can now spot repetitions in large pieces of text. You need to write a computer program to verify his answers. You are given a string of length ''N'' and ''Q'' queries of the form ''M K''. For each query, you need to print the number of times the substring starting at index ''M'' of length ''K'' occurs in the whole string. ', 'The first line of the input file contains an integer ''T'', the number of test cases. Each test case begins with ''N'', the size of the string. The next line contains the string itself. The next line contains ''Q'', the number of queries followed by ''Q'' lines containing the queries which are of the form "M K" , where M is the index at which the new substring starts and ''K'' is the length of the substring.', 'For each query, a single line containing the answer to the query. <br/>', '1 <= T <= 10 <br/> 1 <= N <= 50000<br/> 1 <= Q <= 50000 <br/> 0 <= M<sub>i</sub> < N ,  K >= 1, M + K - 1 < N <br/>All the strings in the input will contain only lowercase letters.', 3, 64, 1, '1<br/>6<br/>abcabc<br/>3<br/>0&nbsp;2<br/>0&nbsp;3<br/>1&nbsp;1<br/>', '2<br/>2<br/>2<br/>', 5, 28, 65, 168);
